:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Samuel and WILLIAMS, Mary
  JWILLIAMS, William Temple and PUCKEY, Annie Matilda Sophia Marilla
  JWILLIAMS, Charles Athol, and BURR, Mary Russell (Meg)
  04> WILLIAMS, Charles Athol m on 21.07.1921 to (1)BURR, Mary Russell (Meg)
  b 23.01.1899 d 03.08.1990
  b 28.11.1890 d 05.04.1978
  Athol b. at Te Aute and m, at St Andrew's Church, Hastings. Mary, d/o Patrick Burr
  and Bessie McWilliam, b, at Normanby and d, at Hastings. Athol is a descendant of
  both Henry and William Williams.
  Athol was educated at Huntley School, Weymouth School (Eng), Wanganui Collegiate
  School and Selwyn College, Cambridge. He farmed on "Te Aute" Station, Pukehou. He
  was a member of the Advisory Committee to the Soil Conservation and River Control
  Council (1943-48); the Waipawa River and Drainage Board; the Primary Production Council (1944-46); Chairman
  of the Waipawa-Ngaruroro Rabbit Board (1946-49); Chairman of the H & W Williams Memorial Trust Board Inc
  (1940-71); a member of the New Zealand Rabbit Destruction Council, He also served on the Waiapu Synod and
  was a lay preacher and a Justice of the Peace. He retired to Hastings about 1949.
  Meg was a wonderful homemaker with a rare gift for creating beauty in home and garden. This, coupled with
  humour and wisdom and a love for people, made their home ever welcoming, not only to family but also to a
  host of others from many different backgrounds and cultures.
  01> WILLIAMS, Patricia Mary m on 26.07.1958 to OJALA, Eric Mervyn
  b 30.08.1922 d 24.09.1996
  b 16.09.1916
  Patricia b. at Hastings and m. at Pukehou. Eric, slo Konsta Ojala and Florence
  Lillian Witheford, b. at Auckland. Address: 29 Greenwood Road, Havelock North.
  Patricia was educated at Chilton Saint James, Woodford House and Canterbury
  University College (BA). Prior to her marriage she taught briefly at Craighead
  Diocesan School, Timaru, Auckland Girls' Grammar and Woodford House and
  travelled in Europe and Australia.
  Eric is an agricultural economist trained at Massey Agricultural College and Oxford University (DPhil).
  After serving with the New Zealand Department of Agriculture he worked for the South Pacific Commission
  in Noumea (1952-55). In 1956 he joined the staff of the Food and Agriculture Organisation of the United
  Nations and, after service in Bangkok and Rome, he retired in 1976 as an Assistant Director General of
  the Organisation. He then assisted Massey University until 1984 in his field of Agricultural Policy
  Studies. He received the QSO in 1986.
  01> OJALA, Helen Jean m on 01.10.1983 to LUCY, Michael Francis
  b 11.01.1963
  b 30.01.1961
  Helen b. at Waipawa. Michael, slo Alan Patrick Lucy and Aline Margaret Ward, b. at Cheviot.
  Address: 104 Frederick Street, Hastings.
  Helen was educated at Junior English School, Rome, Italy; Michael Hall, Forest Row, Sussex, England
  and Rudolf Steiner School, Hastings. She trained as an enrolled nurse and enjoys playing the
  piano.
  Michael was educated at Waimarama Primary School and St John's College, Hastings. He became a
  qualified builder and in 1990 he began an executive career with Carters in Hastings.
  b1> LUCY, James Michael
  b 07.07.1985
  Michael b. at Napier. He is a keen rugby player and had been a member of the Hastings Ross
  Shield team.
  02> LUCY, Patrick William
  b 17.03.1987
  Patrick b. at Hastings. He learns tae kwon do.
  03> LUCY, Alice Helen
  b 11.08.1989
  Alice b. at Hastings. She is learning highland dancing.
